import './Projects.css'

const projectsArr = [
	{
		'title': 'Dreami', 
		'blurb': 'lil dream journal sleep app thing idk',
		'live-app': '',
		'repo': '',
		'screenshot-1': '',
		'screenshot-2': ''
	},
	{
		'title': 'Timely', 
		'blurb': 'All in one Productivity suite with Pomodoro Timer and a to do list, designed to help you get organized and stay organized',
		'live-app': '',
		'repo': '',
		'screenshot-1': '',
		'screenshot-2': ''

	},
	{
		'title': 'FindMySound', 
		'blurb': 'Spotify app designed to help you find your new favorite band',
		'live-app': '',
		'repo': '',
		'screenshot-1': '',
		'screenshot-2': ''

	},
	{
		'title': 'MyMelody', 
		'blurb': 'Simple Jquery keyboard',
		'live': '',
		'repo': '',
		'screenshot-1': '',
		'screenshot-2': ''

	},


]

export default class Projects extends Component{
	renderProjects = projectsArr.map(project =>{
			return(
				<section className ={project.title}>
					<h2> ${project.title} </h2>
					<div className ='{project-title}-img-container'>
						<img alt='screenshot 1' src={project.screenshot-1}> </img>
						<img alt='screenshot 2' src ={project.screenshot-2}> </img>
					</div>
					<p> ${project.blurb} </p>
					<ul>
						<li> ${project.live} </li>
						<li> ${project.repo} </li>
					</ul>
				</section>
				);
		})

	render(){
		return(
			<div className ="Projects">
				{this.renderProjects}
			</div>
		)
	}
}
